import React from 'react'
import styles from '../../styles/Counter.module.css'
export const Counter = ({count}) => {
  return (
    <>
      <button className={styles.ButtonPlus}>+</button>
      <button className={styles.ButtonPlus}>{count}</button>
      <button className={styles.ButtonPlus}>-</button>
    </>
  );
}
